Bluethroat.

  Bluethroat is a Winter Visitor to Indian Subcontinent and usually been active in Summers in Himalayas. In Maharashtra Bluethroat can be seen as arrival of winter till the end of Summers.¬†
  Adult Males and Females have black, blue, Rufous pattering on throat,belly and breasts with Rufous tail. 
Where younger Females lacks of Blue colour on their body. Males have bright Blue coloured throat with orange patch in middle of it (Breeding Plumage).

